import React from 'react'
import ProjectCard from '../../Components/ProjectCard/ProjectCard'
import ForUpdate from '../../Components/ForUpdate/ForUpdate';
import ProjectDescription from '../../Components/ProjectDescription/ProjectDescription';
import ProjectName from '../../Components/ProjectName/ProjectName';
import Cipla from '../../Assets/images/Cipla.png'
import './ProjectDetails.scss'


const ProjectDetails = () => {

  const projectname = [
    {
      projectName: "Cipla",
      logo:Cipla,
      status: "Inprogress",
      duration: "17 Jun - 17 Dec"
    }
  ]

  return (
    <div>
      <div className='ProjectDetails' >
        <div className='ProjectDetails-Head'>
          <p>Project Details</p>
        </div>

        <div>
          {
            projectname && projectname.map((namevalue) =>
            <ProjectName namevalue={namevalue} />)}
        </div>



        <div className='ProjectDetails_Card'>
          <ProjectCard />
        </div>

        <div>
          <ForUpdate />
        </div>
        <div>
          <ProjectDescription />
        </div>

      </div>

    </div>
  )
}

export default ProjectDetails;
